  \"2013-03-15T14:35:20.679802\",\n\t\"name\": \"boundaryother-zcta2000\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A ZIP Code Tabulation Area (ZCTA) is a
  statistical geographic entity that approximates the delivery area for a U.S. Postal
  Service five-digit digit ZIP Code. ZCTAs are aggregations of census blocks that
  have the same predominant ZIP Code associated with the addresses in the U.S. Census
  Bureau's Master Address File (MAF). ZCTAs do not precisely depict ZIP Code delivery
  areas, and do not include all ZIP Codes used for mail delivery. The U.S. Census
  Bureau has established ZCTAs as a new geographic entity similar to, but replacing,
  data tabulations for ZIP Codes undertaken in conjunction with the 1990 and earlier
  censuses. ZIP Code Tabulation Areas (ZCTAs) are a new statistical entity developed
  by the U.S. Census Bureau for tabulating summary statistics from Census 2000. This
  new entity was developed to overcome the difficulties in precisely defining the
  land area covered by each ZIP Codeu00ae. Defining the extent of an area is necessary
  in order to accurately tabulate census data for that area. ZCTAs are generalized
  area representations of U.S. Postal Service (USPS) ZIP Code service areas. Simply
  put, each one is built by aggregating the Census 2000 blocks, whose addresses use
  a given ZIP Code, into a ZCTA which gets that ZIP Code assigned as its ZCTA code.
  They represent the majority USPS five-digit ZIP Code found in a given area. For
  those areas where it is difficult to determine the prevailing five-digit ZIP Code,
  the higher-level three-digit ZIP Code is used for the ZCTA code. TIGER, TIGER/Line,
  and Census TIGER are registered trademarks of the U.S. Census Bureau. ZCTA is a
  trademark of the U.S. Census Bureau.\",\n\t\"license_title\": null,\n\t\"extras\":
